import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import Typography from '@material-ui/core/Typography';
import ButtonBase from '@material-ui/core/ButtonBase';
import Button from '@material-ui/core/Button';
import Card from "@material-ui/core/Card";
import CardActionArea from "@material-ui/core/CardActionArea";
import CardActions from "@material-ui/core/CardActions";
import CardContent from "@material-ui/core/CardContent";
import CardMedia from "@material-ui/core/CardMedia";



const styles = theme => ({
  root: {
    flexGrow: 1,
  },
  mainStyle: {
    paddingRight: theme.spacing.unit * 8,
    paddingBottom: theme.spacing.unit * 2,
    paddingLeft: theme.spacing.unit * 3,
    marginBottom: 5,
    maxWidth: '100%',
  },
});

class PastMeetups extends React.Component{
    render(){
      const { classes, theme} = this.props;
      console.log(this.props.people,"<========= props")
      console.log(this.props.posts,"<========= props2")
      console.log("===========================================");
    
  return (

    
    <div className={classes.mainStyle}>
       <ul>       
       <React.Fragment>
            
              this.props.people.map((data,idx) => {
             
                <React.Fragment key={idx}>
                  <li> name: {data.name} </li> 
                  <li> status: {data.status} </li>
                </React.Fragment>
              
            })
            
           
        </React.Fragment>
      </ul>  
    </div> 

    
    );
    }
}

export default withStyles(styles, { withTheme: true })(PastMeetups);
